import { Outlet, Link } from "react-router-dom";
import React from "react";
import NavBar from "./NavBar";
import Footer from "./Footer";

const Layout = () => {
  return (
    <>
      <nav>
        <NavBar/>
      </nav>
<Outlet/>
      <footer>
        <Footer/>
      </footer>
    </>
  )
};

export default Layout;
